import React from 'react'
import {render} from 'react-dom'

function Article() {
  const body = <section>body</section>
	return(
    	<div className="title">
       		<h1>title</h1>
          	{body}
        	<h3>creation date: {(new Date).toDateString()}</h3>
        </div>
    )
}

function App(){
	return(
    	<div>
        	<h1>App name</h1>
        	<Article />
        </div>
    )
}
